import { Badge } from 'react-bootstrap';

const MovieRating = ({ rating }) => {


  return (
    <>
    {
        <Badge className='badge bg-warning text-dark'>{rating}/10</Badge>   
    }
    </>
  );


};

export default MovieRating;
